import React from "react";
import Projects from "./Projects";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header>
        <menu>
          <a href="#">Home</a>
          <a href="#">About me</a>
          <a href="#">Portfolio</a>
          <a href="#">Contact me</a>
        </menu>
      </header>
      <main>
        <Projects></Projects>
      </main>
    </div>
  );
}

export default App;
